				<Routes>
					<Route path="/" element={<div></div>} />
					<Route path="/register" element={<Register />} />
					<Route path="/email" element={<Email />} />
					<Route path="/email" element={<Email />} />
					<Route path="/pan" element={<Pan />} />
					<Route path="*" element={<PageNotFound />} />
				</Routes>
			</div>
		</div>
	);
}

export default function App() {
	return (
		<Router>
			<AppLayout />
		</Router>
	);
}
